import React from "react";
import * as BooksAPI from "./BooksAPI";
import "./App.css";

class BooksApp extends React.Component {
  state = {
    books: [],
  };
  componentDidMount = async () => {
    const books = await BooksAPI.getAll();
    this.setState({ books });
  };
  render() {

    return <div className="app" />;
  }
}
export default BooksApp;
